class ColumnContainer extends React.Component {
    render() {
        return ( 
            <div style = {{display:"flex", flexDirection:"column"}}>
                {this.props.children}
            </div>
        )
    }
}
class ColumnContainerExtended extends React.Component {
    render() {
        return ( 
            <div style = {{display:"flex", flexDirection:"column"}}>
                {this.props.children}
            </div>
        )
    }
}



